import { createStore } from "vuex";

const state = {
  imageBaW:
    "data:image/jpeg;base64,",

  imageColor:
    "data:image/jpeg;base64,",
  mappedImage: [],
};

const mutations = {
  pushMappedImageRow(state, row) {
    state.mappedImage.push(row);
  },
  resetMappedImage(state) {
    state.mappedImage = [];
    console.log("yay");
  },
};

export default createStore({
  state,
  mutations,
});
